Sure thing! Here's an example of how you can sort a JavaScript object (or dictionary) by its keys alphabetically and output the values:
```
const obj = {
  "a": 1,
  "b": 2,
  "c": 3,
  "d": 4,
  "e": 5
};

const sortedKeys = Object.keys(obj).sort();
const output = {};

sortedKeys.forEach((key) => {
  output[key] = obj[key];
});

console.log(output);
```
This will output the following:
```
{
  "a": 1,
  "b": 2,
  "c": 3,
  "d": 4,
  "e": 5
}
```
The `Object.keys()` method returns an array of the object's keys, which we then sort alphabetically using the built-in `sort()` method. We then iterate over the sorted keys using a `forEach()` loop and use the `output` object to store the values corresponding to each key. Finally, we log the `output` object to the console.

